def solution(stdin: str) -> str:
    length = len(stdin)
    stacks = []
    stack_size = 0

    for index in range(length):
        if stdin[index] == "|":
            if stack_size == 0:
                stacks.append(index)
            else:
                if stack_size == 1:
                    stacks.append(index)
                else:
                    stacks[-2] = index
            stack_size += 1
        elif stdin[index] == ":":
            if stack_size == 1:
                stacks.append(index)
            else:
                stacks[-2] = index
            stack_size -= 1
        elif stdin[index] == "[":
            stacks.append(index)
        elif stdin[index] == "]":
            stack_size -= 1
            if stack_size == 0:
                stacks.pop()
    stacks = [x - i for i, x in enumerate(stacks)]

    if stack_size == 0:
        return "".join([x for x in stdin[:stacks[0]]])

    return "".join([x for x in stdin[:stacks[0]]]) + "".join([x for x in stdin[stacks[-1] + 1 :]])

