    input = stdin.strip().split()
    n = int(input[0])
    s = input[1]
    b = list(map(int, input[2].split()))
    best = 0

    # First we count how many characters can be reordered for each index to get an antipalindromic string
    count = {}
    for i in range(1, n + 1):
        count[i] = count.get(i, 0) + 1

    for i in range(1, n + 1):
        if count[i] == 0:
            continue
        # We now get the string s[i] = s[0], s[1],..., s[i-1], and count how many characters can be reordered for each index to get an antipalindromic string
        s_i = s[i - 1]
        count[i] = count.get(i, 0) + count.get(i - 1, 0)
        for j in range(i, n + 1):
            if j == i:
                continue
            if s_i == s[j]:
                count[i] += count.get(j, 0)

    # Then we calculate the best we can get by checking the beauty of all possible indices
    for i in range(1, n + 1):
        if count[i] == 0:
            continue
        best = max(best, count[i] + b[i - 1])

    return best

