    if total > l:
        return "NO"

    def binary_search(low, high, limit):
        mid = (low + high) // 2
        if low > high:
            return -1

        if mid * 2 < limit:
            return binary_search(mid + 1, high, limit)
        elif mid * 2 > limit:
            return binary_search(low, mid, limit)
        else:
            return mid

    def optimal(n, total, low, high):
        if total == low and total == high:
            return 0

        if total == low:
            return -1

        if total == high:
            return high - low

        mid = binary_search(low, high, total)

        return min(
            optimal(n, total - costs[mid], low, mid),
            optimal(n, total, mid + 1, high),
        )

    return str(optimal(n, total, 0, n))

