    depths = {nodes[i]: tree_depth(nodes[i]) for i in range(len(nodes))}

    def is_bal(n: 'Node') -> bool:
        """
        check if n is balanced or not
        """
        if not n:
            return True

        if abs(depths[n.left] - depths[n.right]) > 1:
            return False

        return is_bal(n.left) and is_bal(n.right)


    # check if all the trees are balanced
    for n in nodes:
        if not is_bal(n):
            return 0

    # check if all the keys are distinct
    keys = {n.key for n in nodes}
    if len(keys)!= len(nodes):
        return 0

    # check if the keys are even and odd
    even = {k for k in keys if k % 2 == 0}
    odd = {k for k in keys if k % 2 == 1}
    if len(even)!= len(nodes) or len(odd)!= len(nodes):
        return 0

    # compute the modulo using bin(i)
    # bin(i) : f'(i)
    def mod(n: int) -> int:
        return (1 << n) - 1

