    # - If there is no such string, return 0.
    # - Create a set of all the substrings in S
    # - For each string in S, check if it is in the set of all the substrings. If it is not, return 0.
    # - If it is in the set of substrings, increment the count and return the maximum count
    # - If all the counts of the strings in S are 1, return max(max(strings) - min(strings))
    strings: set = {S[i:i+len(S)] for i in range(0, len(S))}
    count = 1
    # If there are no strings in S, return 0.
