    def is_self_intersecting(point):
        """
        For a given point, if point has any of its neighbors with same x or y then return True else return False.
        """
        x, y = point
        for i in range(x - 1, x + 2):
            for j in range(y - 1, y + 2):
                if i!= x and j!= y and (i, j) in points:
                    return True
        return False

    def max_length(points):
        """
        Calculate the max length of the polyline.
        """
        _len = 0
        for i in range(len(points) - 1):
            dx, dy = points[i][0] - points[i + 1][0], points[i][1] - points[i + 1][1]
            if dx == 0 and dy == 0:
                _len += 1
            else:
                _len += (abs(dx) + abs(dy))
        return _len

    start, end = 0, max(points, key=lambda p: p[1])
    while start <= end:
        mid = (start + end) // 2
        if is_self_intersecting((mid, 0)):
            start = mid + 1
        else:
            end = mid - 1
    return str(start), str(max_length((start, mid)))

