        visited = [False] * (vertex_count + 1)
        for i in range(1, vertex_count + 1):
            if not visited[i]:
                visited[i] = True
                stack = []
                stack.append(i)
                while stack:
                    cur_vertex = stack.pop()
                    for adj_vertex in graph[cur_vertex]:
                        if not visited[adj_vertex]:
                            visited[adj_vertex] = True
                            stack.append(adj_vertex)
        return all(visited)

