    a = sorted(list(map(int, stdin.split())))

    def dfs(idx: int, a: List[int], m: int, n: int):
        if idx >= n:
            return m == n
        if a[idx] == m:
            return dfs(idx + 1, a, m + 1, n)
        else:
            return dfs(idx + 1, a, m, n) or dfs(idx + 1, a, m, n - a[idx])

    return 'YES' if dfs(0, a, 0, n) else 'NO'


